package com.datastucture.strings;

import java.util.Arrays;

public class IsAnyCombinationPalindrome {

    public static void main(String args[]) {
        System.out.println(" Result " + isAnyStringCombinationAPalindrome(""));
    }

    private static boolean isAnyStringCombinationAPalindrome(String str) {
        int[] charCountArray = new int[200];
        char[] inputCharArray = str.toCharArray();
        Arrays.fill(charCountArray,  0);

        for (int i = 0; i < inputCharArray.length; i++) {
            charCountArray[inputCharArray[i]] += 1;
        }

        int numberOfOddChars = 0;

        for (int charCount: charCountArray) {

            if (charCount != 0) {
                if (charCount % 2 != 0) {
                    numberOfOddChars++;
                }
            }
        }

        if (inputCharArray.length % 2 == 0) {
            return numberOfOddChars <= 0;
        } else {
            return numberOfOddChars <= 1;
        }
    }
}
